window.bookSummaryJSON = "<p>For most women, being newly engaged to the love of your life is a time of celebration. But Sunaya's happiness is overshadowed by loss. Her friends have not returned from their quest to bring back Noria, and though the Resistance has been beaten back, they are far from vanquished. </p> <p>When the Minister sends Sunaya and Iannis to destroy an important Resistance stronghold, Sunaya is torn between the desire to help her friends and defend her country. But soon she finds that the two are not as unrelated as she imagined...and in order to accomplish both, she must put her trust in a man who has betrayed her. </p>"; 
